    false,nt"url": null,nt"notes": "LRS2014 is a Linear Referencing System
    layer that includes interstate, U.S., state (VT), and other transportation routes
    logged by the Vermont Agency of Transportation. The routes in this layer represent
    the ETE route system, where ETE stands for End-to-End-Based route system, meaning
    that routes increment from start to finish within the state. The routes represent
    the full routes from begining to end with no breaks for towns. The lines and attributes
    were extracted from TransRoad_RDS (12/2014 version of RDSMALL - 2014 HMS update)
    and calibrated to the route logs points (12/2014 version of RTLOGPTS - 2014 HMS
    update).",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
